class Solution {
    public boolean solution(List<Integer> L, int K) {
        /**
         * If the whole system can verify that the specified multiinstaller should exist in the designated interval within the specified number, then return true; otherwise, return false.
         *
         * Ensure that after sorting, there is no duplicate number.
         */

        Arrays.sort(L);

        for(int m=0;m<L.size();++m){
            for(int n=m+1;n<L.size();++n){
                if(L.get(m)<=L.get(n)){
                    int temp = L.get(n);
                    L.set(n,L.get(m));
                    L.set(m,temp);
                }
            }
        }

        return zhuanhuabanbochiang(L,K)?true:false;
    }

    private boolean zhuanhuabanbochiang(List<Integer> L, int K){
        /**
         * return false if count is not equal to specified n * n checker board number; otherwise, return true
         */

        int total = 0;
        for(int i=0;i<L.size();++i){
            total += L.get(i);
            if(total==K){
                return true;
            }
        }
        return false;
    }
}


